package com.platform.rp.services.store.external.vo;

import java.io.Serializable;
import java.util.Date;


/**
 * The persistent class for the bs_store_employee_divided database table.
 * 门店分成人员表
 * 
 */
public class BsStoreEmployeeDividedVo implements Serializable {
	private static final long serialVersionUID = 1L;
	private long id;
	private long empId;
	private int status;
	private long storeId;
	private Date updateTime;
	
	//非数据库字段
	private String empName;
	private String empNickName;
	private String headPic;	
	private Integer rewardEmpId;
	private String percent;
	private String money;
	private String jobTitle;
	public BsStoreEmployeeDividedVo() {
	}
	
	

	public String getJobTitle() {
		return jobTitle;
	}



	public void setJobTitle(String jobTitle) {
		this.jobTitle = jobTitle;
	}



	public Integer getRewardEmpId() {
		return rewardEmpId;
	}



	public void setRewardEmpId(Integer rewardEmpId) {
		this.rewardEmpId = rewardEmpId;
	}



	public String getPercent() {
		return percent;
	}



	public void setPercent(String percent) {
		this.percent = percent;
	}



	public String getMoney() {
		return money;
	}



	public void setMoney(String money) {
		this.money = money;
	}



	public String getHeadPic() {
		return headPic;
	}



	public void setHeadPic(String headPic) {
		this.headPic = headPic;
	}



	public String getEmpNickName() {
		return empNickName;
	}




	public void setEmpNickName(String empNickName) {
		this.empNickName = empNickName;
	}




	public String getEmpName() {
		return empName;
	}

	public void setEmpName(String empName) {
		this.empName = empName;
	}

	public long getId() {
		return id;
	}

	public void setId(long id) {
		this.id = id;
	}

	public long getEmpId() {
		return empId;
	}

	public void setEmpId(long empId) {
		this.empId = empId;
	}

	public int getStatus() {
		return status;
	}

	public void setStatus(int status) {
		this.status = status;
	}

	public long getStoreId() {
		return storeId;
	}

	public void setStoreId(long storeId) {
		this.storeId = storeId;
	}


	public Date getUpdateTime() {
		return updateTime;
	}

	public void setUpdateTime(Date updateTime) {
		this.updateTime = updateTime;
	}


	
}